import React from 'react';
import {
  Card,
  Checkbox,
  FormControl,

  Typography,
} from '@mui/material';
import { Box } from '@mui/joy';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import Slider from '@mui/material/Slider';
import Header from './Header';
import BasicCard from './Cards';
import CustomIcons from './Pagination';


const optionsCat = [
  { id: '1', label: 'Литые елки' },
  { id: '2', label: 'Уличные елки' },
  { id: '3', label: 'Елки с лампочками' },
  { id: '4', label: 'Заснежные елки' },
  { id: '5', label: 'Комбинированные елки' },
  { id: '6', label: 'Настольные елки' },
];

const optionsHeigth = [
  { id: '1', label: '100 см' },
  { id: '2', label: '110 см' },
  { id: '3', label: '110 см' },
  { id: '4', label: '110 см' },
  { id: '5', label: '110 см' },
  { id: '6', label: '110 см' },
  { id: '7', label: '110 см' },
  { id: '8', label: '110 см' },
  { id: '9', label: '110 см' },
  { id: '10', label: '110 см' },
  { id: '11', label: '110 см' },
];

const optionsRadius = [
  { id: '1', label: '50 см' },
  { id: '2', label: '50 см' },
  { id: '3', label: '50 см' },
  { id: '4', label: '50 см' },
  { id: '5', label: '50 см' },
  { id: '6', label: '50 см' },
];

export default function FormControlLabelPosition() {
  const [heigth, setHeigth] = React.useState('');
  const [radius, setRad] = React.useState('radius');
  const [branch, setBranch] = React.useState('branch');
  const [value, setValue] = React.useState([25000, 70000]);
  const [selectedCategory, setSelectedCategory] = React.useState('');

  const handleChange = (event) => {
    setSelectedCategory(event.target.value);
  }

  const handleChangeHeigth = (event) => {
    setHeigth(event.target.value);
  };

  function valuetext(value) {
    return `${value.toLocaleString()}₽`;
  }

  return (
    <>
      <Header />
      <Box
        paddingTop={'70px'}
        display={'flex'}
        flexDirection={'row'}
        justifyContent={'space-between'}
        gap={'30px'}
        width={'65%'}
      >
        <Typography fontSize={'1.6em'}>Фильтр подбора</Typography>
        <Typography fontSize={'1.6em'}>Искусственные елки</Typography>
      </Box>
      <Box
        display={'flex'}
        flexDirection={'column'}
        gap={'10px'}
        width={'210px'}
        borderRadius={'8px'}
        sx={{ backgroundColor: 'white', position: 'absolute' }}
      >
       <FormControl sx={{ m: 1, minWidth: 120 }} size='small'>
          <InputLabel id='demo-select-small-label'>Категории</InputLabel>
          <Select
            labelId='demo-select-small-label'
            id='demo-select-small'
            value={heigth}
            label='Age'
            onChange={handleChangeHeigth}
            sx={{ width: '150px' }}
          >
            {optionsHeigth.map(({ id, label }) => (
              <MenuItem key={id} value={id}>
                {label}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <FormControl sx={{ m: 1, minWidth: 120 }} size='small'>
          <InputLabel id='demo-select-small-label'>Высота</InputLabel>
          <Select
            labelId='demo-select-small-label'
            id='demo-select-small'
            value={heigth}
            label='Age'
            onChange={handleChangeHeigth}
            sx={{ width: '150px' }}
          >
            {optionsHeigth.map(({ id, label }) => (
              <MenuItem key={id} value={id}>
                {label}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <FormControl sx={{ m: 1, minWidth: 120 }} size='small'>
          <InputLabel id='demo-select-small-label'>Диаметр</InputLabel>
          <Select
            labelId='demo-select-small-label'
            id='demo-select-small'
            value={heigth}
            label='Age'
            onChange={handleChangeHeigth}
            sx={{ width: '150px' }}
          >
            {optionsHeigth.map(({ id, label }) => (
              <MenuItem key={id} value={id}>
                {label}
              </MenuItem>
            ))}
          </Select>
        </FormControl>


<FormControl>
<FormControl sx={{ m: 1, minWidth: 120 }} size='small'>
          <InputLabel id='demo-select-small-label'>Крепления веток</InputLabel>
          <Select
            labelId='demo-select-small-label'
            id='demo-select-small'
            value={heigth}
            label='Age'
            onChange={handleChangeHeigth}
            sx={{ width: '150px' }}
          >
            {optionsHeigth.map(({ id, label }) => (
              <MenuItem key={id} value={id}>
                {label}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
</FormControl>
        <Box
          sx={{
            width: 150,
            marginLeft: '10px',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Typography>Стоимость</Typography>
          <Slider
            getAriaLabel={() => 'Range of prices'}
            value={value}
            onChange={setValue}
            valueLabelDisplay='auto'
            getAriaValueText={valuetext}
            min={5000}
            max={130000}
          />
        </Box>
      </Box>
      <Box marginLeft={'15%'} display={'flex'} flexWrap={'wrap'} gap={'10px'} >
        <BasicCard />
        <CustomIcons  />
      </Box>

    </>
  );
}
